import './App.css';
// import CharacterList from './components/Characters';
import BBList from './components/BB';
import BCSList from './components/BCS';
import Image from './components/SerieImage';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"

function App() {
  return (
    <Router>
      <div className="App">
        <Link to='/' className="Inicio">
          <h1> Tarea 1 </h1>
        </Link>
        <hr />
        <Switch>
          <Route path="/">
            <div className="row">
              <div className="column">
                < Image nom={'bb'} />
                < BBList />
              </div>
              <div className="column">
                < Image nom={'bcs'} />
                < BCSList />
              </div>
            </div>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
